tion\":\"从操作系统的角度，返回 Redis 已分配的内存总量（俗称常驻集大小）。这个值和 top 、 ps 等命令的输出一致\",\"key\":\"used_memory_rss\",\"value\":\"678120\"},{\"description\":\"最近一次rdb持久化是否成功\",\"key\":\"rdb_last_bgsave_status\",\"value\":\"ok\"},{\"description\":\"服务器进程的 PID\",\"key\":\"process_id\",\"value\":\"4032\"},{\"description\":\"拒绝的连接个数，redis连接个数达到maxclients限制，拒绝新连接的个数\",\"key\":\"rejected_connections\",\"value\":\"0\"},{\"description\":\"服务器是否正在创建rdb文件\",\"key\":\"rdb_bgsave_in_progress\",\"value\":\"0\"},{\"key\":\"cluster_enabled\",\"value\":\"0\"},{\"description\":\"TCP/IP 监听端口\",\"key\":\"tcp_port\",\"value\":\"6379\"},{\"description\":\"Redis 服务器的宿主操作系统\",\"key\":\"os\",\"value\":\"Windows  \"},{\"description\":\"如果rewrite操作正在进行，则记录所使用的时间，单位秒\",\"key\":\"aof_current_rewrite_time_sec\",\"value\":\"-1\"},{\"key\":\"repl_backlog_histlen\",\"value\":\"0\"},{\"key\":\"role\",\"value\":\"master\"},{\"key\":\"used_cpu_sys\",\"value\":\"5.38\"},{\"description\":\"上次bgrewrite aof操作的状态\",\"key\":\"aof_last_bgrewrite_status\",\"value\":\"ok\"},{\"description\":\"以人类可读的格式返回 Redis 的内存消耗峰值\",\"key\":\"used_memory_peak_human\",\"value\":\"735.10K\"},{\"key\":\"hz\",\"value\":\"10\"},{\"description\":\"以人类可读的格式返回 Redis 分配的内存总量\",\"key\":\"used_memory_human\",\"value\":\"699.11K\"},{\"key\":\"mem_fragmentation_ratio\",\"value\":\"0.95\"},{\"description\":\"最近一次成功生成rdb文件耗时秒数\",\"key\":\"rdb_last_bgsave_time_sec\",\"value\":\"0\"},{\"description\":\"正在等待阻塞命令（BLPOP、BRPOP、BRPOPLPUSH）的客户端的数量\",\"key\":\"blocked_clients\",\"value\":\"0\"},{\"key\":\"used_cpu_sys_children\",\"value\":\"0.00\"},{\"key\":\"repl_backlog_active\",\"value\":\"0\"},{\"key\":\"used_cpu_user_children\",\"value\":\"0.00\"},{\"key\":\"sync_partial_ok\",\"value\":\"0\"},{\"description\":\"标识aof的rewrite操作是否在进行中\",\"key\":\"aof_rewrite_in_progress\",\"value\":\"0\"},{\"key\":\"redis_git_sha1\",\"value\":\"00000000\"},{\"description\":\"当前连接的客户端当中，最长的输出列表\",\"key\":\"client_longest_output_list\",\"value\":\"0\"},{\"description\":\"如果服务器正在创建rdb文件，那么这个域记录的就是当前的创建操作已经耗费的秒数\",\"key\":\"rdb_current_bgsave_time_sec\",\"value\":\"-1\"},{\"description\":\"最近一次aof rewrite耗费的时长\",\"key\":\"aof_last_rewrite_time_sec\",\"value\":\"-1\"},{\"description\":\"配置文件目录\",\"key\":\"config_file\",\"value\":\"D:Redis\\redis.windows.conf\"},{\"description\":\"服务器是否正在载入持久化文件\",\"key\":\"loading\",\"value\":\"0\"},{\"key\":\"pubsub_channels\",\"value\":\"0\"},{\"key\":\"db0\",\"value\":\"keys=2,expires=2,avg_ttl=1246862\"},{\"key\":\"migrate_cached_sockets\",\"value\":\"0\"},{\"key\":\"redis_git_dirty\",\"value\":\"0\"},{\"description\":\"已连接客户端的数量（不包括通过从属服务器连接的客户端）\",\"key\":\"connected_clients\",\"value\":\"2\"},{\"description\":\" 以分钟为单位进行自增的时钟，用于 LRU 管理\",\"key\":\"lru_clock\",\"value\":\"5140990\"},{\"key\":\"pubsub_patterns\",\"value\":\"0\"},{\"key\":\"repl_backlog_first_byte_offset\",\"value\":\"0\"},{\"description\":\"redis网络出口流量字节数\",\"key\":\"total_net_output_bytes\",\"value\":\"19117469\"},{\"key\":\"client_biggest_input_buf\",\"value\":\"0\"},{\"description\":\"运行以来剔除(超过了maxmemory后)的key的数量\",\"key\":\"evicted_keys\",\"value\":\"0\"},{\"key\":\"total_connections_received\",\"value\":\"143\"},{\"description\":\"Redis 服务器版本\",\"key\":\"redis_version\",\"value\":\"3.0.504\"},{\"description\":\"redis网络入口流量字节数\",\"key\":\"total_net_input_bytes\",\"value\":\"1396011\"},{\"key\":\"latest_fork_usec\",\"value\":\"57184\"},{\"description\":\" Redis 的内存消耗峰值(以字节为单位)\",\"key\":\"used_memory_peak\",\"value\":\"752744\"},{\"description\":\"命中次数\",\"key\":\"keyspace_hits\",\"value\":\"14768\"},{\"description\":\"自 Redis 服务器启动以来，经过的天数\",\"key\":\"uptime_in_days\",\"value\":\"5\"},{\"description\":\"redis网络入口kps\",\"key\":\"instantaneous_input_kbps\",\"value\":\"0.17\"},{\"key\":\"rdb_last_save_time\",\"value\":\"1582199247\"},{\"description\":\"redis当前的qps，redis内部较实时的每秒执行的命令数\",\"key\":\"instantaneous_ops_per_sec\",\"value\":\"2\"}]}', '0', null, '2020-02-20 19:48:14');
