INSERT INTO `sys_oper_log` VALUES ('5307', '获取Redis信息', '0', 'com.ruoyi.project.monitor.controller.RedisController.info()', 'GET', '1', 'admin', null, '/monitor/redis/info', '127.0.0.1', '内网IP', '{}', '{\"msg\":\"操作成功\",\"code\":200,\"data\":[{\"key\":\"aof_rewrite_scheduled\",\"value\":\"0\"},{\"description\":\"没命中次数\",\"key\":\"keyspace_misses\",\"value\":\"91\"},{\"key\":\"mem_allocator\",\"value\":\"jemalloc-3.6.0\"},{\"description\":\"Redis 所使用的事件处理机制\",\"key\":\"multiplexing_api\",\"value\":\"WinSock_IOCP\"},{\"description\":\"上次aof写入状态\",\"key\":\"aof_last_write_status\",\"value\":\"ok\"},{\"description\":\"Redis 服务器的随机标识符（用于 Sentinel 和集群）\",\"key\":\"run_id\",\"value\":\"1ef3454c7717de08614dc987627e13fa3a0eb7c0\"},{\"description\":\"自 Redis 服务器启动以来，经过的秒数\",\"key\":\"uptime_in_seconds\",\"value\":\"438752\"},{\"description\":\" 架构（32 或 64 位）\",\"key\":\"arch_bits\",\"value\":\"64\"},{\"key\":\"master_repl_offset\",\"value\":\"0\"},{\"description\":\"redis网络出口kps\",\"key\":\"instantaneous_output_kbps\",\"value\":\"5.36\"},{\"description\":\"redis处理的命令数\",\"key\":\"total_commands_processed\",\"value\":\"20995\"},{\"key\":\"repl_backlog_size\",\"value\":\"1048576\"},{\"key\":\"sync_full\",\"value\":\"0\"},{\"key\":\"sync_partial_err\",\"value\":\"0\"},{\"key\":\"used_cpu_user\",\"value\":\"4.23\"},{\"description\":\"是否开启了aof\",\"key\":\"aof_enabled\",\"value\":\"0\"},{\"description\":\"运行模式，单机（standalone）或者集群（cluster）\",\"key\":\"redis_mode\",\"value\":\"standalone\"},{\"description\":\"离最近一次成功生成rdb文件，写入命令的个数，即有多少个写入命令没有持久化\",\"key\":\"rdb_changes_since_last_save\",\"value\":\"2\"},{\"description\":\"Lua 引擎所使用的内存大小（以字节为单位）\",\"key\":\"used_memory_lua\",\"value\":\"36864\"},{\"key\":\"redis_build_id\",\"value\":\"a4f7a6e86f2d60b3\"},{\"key\":\"connected_slaves\",\"value\":\"0\"},{\"description\":\"运行以来过期的key的数量\",\"key\":\"expired_keys\",\"value\":\"61\"},{\"description\":\"由 Redis 分配器分配的内存总量，以字节（byte）为单位\",\"key\":\"used_memory\",\"value\":\"720208\"},{\"description\":\"从操作系统的角度，返回 Redis 已分配的内存总量（俗称常驻集大小）。这个值和 top 、 ps 等命令的输出一致\",\"key\":\"used_memory_rss\",\"value\":\"719288\"},{\"description\":\"最近一次rdb持久化是否成功\",\"key\":\"rdb_last_bgsave_status\",\"value\":\"ok\"},{\"description\":\"服务器进程的 PID\",\"key\":\"process_id\",\"value\":\"4032\"},{\"description\":\"拒绝的连接个数，redis连接个数达到maxclients限制，拒绝新连接的个数\",\"key\":\"rejected_connections\",\"value\":\"0\"},{\"description\":\"服务器是否正在创建rdb文件\",\"key\":\"rdb_bgsave_in_progress\",\"value\":\"0\"},{\"key\":\"cluster_enabled\",\"value\":\"0\"},{\"description\":\"TCP/IP 监听端口\",\"key\":\"tcp_port\",\"value\":\"6379\"},{\"description\":\"Redis 服务器的宿主操作系统\",\"key\":\"os\",\"value\":\"Windows  \"},{\"description\":\"如果rewrite操作正在进行，则记录所使用的时间，单位秒\",\"key\":\"aof_current_rewrite_time_sec\",\"value\":\"-1\"},{\"key\":\"repl_backlog_histlen\",\"value\":\"0\"},{\"key\":\"role\",\"value\":\"master\"},{\"key\":\"used_cpu_sys\",\"value\":\"5.56\"},{\"description\":\"上次bgrewrite aof操作的状态\",\"key\":\"aof_last_bgrewrite_status\",\"value\":\"ok\"},{\"description\":\"以人类可读的格式返回 Redis 的内存消耗峰值\",\"key\":\"used_memory_peak_human\",\"value\":\"735.10K\"},{\"key\":\"hz\",\"value\":\"10\"},{\"description\":\"以人类可读的格式返回 Redis 分配的内存总量\",\"key\":\"used_memory_human\",\"value\":\"703.33K\"},{\"key\":\"mem_fragmentation_ratio\",\"value\":\"1.00\"},{\"description\":\"最近一次成功生成rdb文件耗时秒数\",\"key\":\"rdb_last_bgsave_time_sec\",\"value\":\"1\"},{\"description\":\"正在等待阻塞命令（BLPOP、BRPOP、BRPOPLPUSH）的客户端的数量\",\"key\":\"blocked_clients\",\"value\":\"0\"},{\"key\":\"used_cpu_sys_children\",\"value\":\"0.00\"},{\"key\":\"repl_backlog_active\",\"value\":\"0\"},{\"key\":\"used_cpu_user_children\",\"value\":\"0.00\"},{\"key\":\"sync_partial_ok\",\"value\":\"0\"},{\"description\":\"标识aof的rewrite操作是否在进行中\",\"key\":\"aof_rewrite_in_progress\",\"value\":\"0\"},{\"key\":\"redis_git_sha1\",\"value\":\"00000000\"},{\"description\":\"当前连接的客户端当中，最长的输出列表\",\"key\":\"client_longest_output_list\",\"value\":\"0\"},{\"description\":\"如果服务器正在创建rdb文件，那么这个域记录的就是当前的创建操作已经耗费的秒数\",\"key\":\"rdb_current_bgsave_time_sec\",\"value\":\"-1\"},{\"description\":\"最近一次aof rewrite耗费的时长\",\"key\":\"aof_last_rewrite_time_sec\",\"value\":\"-1\"},{\"description\":\"配置文件目录\",\"key\":\"config_file\",\"value\":\"D:Redis\\redis.windows.conf\"},{\"description\":\"服务器是否正在载入持久化文件\",\"key\":\"loading\",\"value\":\"0\"},{\"key\":\"pubsub_channels\",\"value\":\"0\"},{\"key\":\"db0\",\"value\":\"keys=6,expires=5,avg_ttl=1608013\"},{\"key\":\"migrate_cached_sockets\",\"value\":\"0\"},{\"key\":\"redis_git_dirty\",\"value\":\"0\"},{\"description\":\"已连接客户端的数量（不包括通过从属服务器连接的客户端）\",\"key\":\"connected_clients\",\"value\":\"2\"},{\"description\":\" 以分钟为单位进行自增的时钟，用于 LRU 管理\",\"key\":\"lru_clock\",\"value\":\"5142188\"},{\"key\":\"pubsub_patterns\",\"value\":\"0\"},{\"key\":\"repl_backlog_first_byte_offset\",\"value\":\"0\"},{\"description\":\"redis网络出口流量字节数\",\"key\":\"total_net_output_bytes\",\"value\":\"19887811\"},{\"key\":\"client_biggest_input_buf\",\"value\":\"0\"},{\"description\":\"运行以来剔除(超过了maxmemory后)的key的数量\",\"key\":\"evicted_keys\",\"value\":\"0\"},{\"key\":\"total_connections_received\",\"value\":\"149\"},{\"description\":\"Redis 服务器版本\",\"key\":\"redis_version\",\"value\":\"3.0.504\"},{\"description\":\"redis网络入口流量字节数\",\"key\":\"total_net_input_bytes\",\"value\":\"1454082\"},{\"key\":\"latest_fork_usec\",\"value\":\"353645\"},{\"description\":\" Redis 的内存消耗峰值(以字节为单位)\",\"key\":\"used_memory_peak\",\"value\":\"752744\"},{\"description\":\"命中次数\",\"key\":\"keyspace_hits\",\"value\":\"15377\"},{\"description\":\"自 Redis 服务器启动以来，经过的天数\",\"key\":\"uptime_in_days\",\"value\":\"5\"},{\"description\":\"redis网络入口kps\",\"key\":\"instantaneous_input_kbps\",\"value\":\"0.32\"},{\"key\":\"rdb_last_save_time\",\"value\":\"1582200479\"},{\"description\":\"redis当前的qps，redis内部较实时的每秒执行的命令数\",\"key\":\"instantaneous_ops_per_sec\",\"value\":\"5\"}]}', '0', null, '2020-02-20 20:08:12');
