INSERT INTO `sys_oper_log` VALUES ('6752', '获取Redis信息', '0', 'com.ruoyi.project.monitor.controller.RedisController.info()', 'GET', '1', 'admin', null, '/monitor/redis/info', '127.0.0.1', '内网IP', '{}', '{\"msg\":\"操作成功\",\"code\":200,\"data\":[{\"key\":\"aof_rewrite_scheduled\",\"value\":\"0\"},{\"description\":\"没命中次数\",\"key\":\"keyspace_misses\",\"value\":\"28\"},{\"key\":\"mem_allocator\",\"value\":\"jemalloc-3.6.0\"},{\"description\":\"Redis 所使用的事件处理机制\",\"key\":\"multiplexing_api\",\"value\":\"WinSock_IOCP\"},{\"description\":\"上次aof写入状态\",\"key\":\"aof_last_write_status\",\"value\":\"ok\"},{\"description\":\"Redis 服务器的随机标识符（用于 Sentinel 和集群）\",\"key\":\"run_id\",\"value\":\"13b935820f98f1520ce68166cd4844a744244791\"},{\"description\":\"自 Redis 服务器启动以来，经过的秒数\",\"key\":\"uptime_in_seconds\",\"value\":\"96814\"},{\"description\":\" 架构（32 或 64 位）\",\"key\":\"arch_bits\",\"value\":\"64\"},{\"key\":\"master_repl_offset\",\"value\":\"0\"},{\"description\":\"redis网络出口kps\",\"key\":\"instantaneous_output_kbps\",\"value\":\"4.44\"},{\"description\":\"redis处理的命令数\",\"key\":\"total_commands_processed\",\"value\":\"3339\"},{\"key\":\"repl_backlog_size\",\"value\":\"1048576\"},{\"key\":\"sync_full\",\"value\":\"0\"},{\"key\":\"sync_partial_err\",\"value\":\"0\"},{\"key\":\"used_cpu_user\",\"value\":\"1.58\"},{\"description\":\"是否开启了aof\",\"key\":\"aof_enabled\",\"value\":\"0\"},{\"description\":\"运行模式，单机（standalone）或者集群（cluster）\",\"key\":\"redis_mode\",\"value\":\"standalone\"},{\"description\":\"离最近一次成功生成rdb文件，写入命令的个数，即有多少个写入命令没有持久化\",\"key\":\"rdb_changes_since_last_save\",\"value\":\"5\"},{\"description\":\"Lua 引擎所使用的内存大小（以字节为单位）\",\"key\":\"used_memory_lua\",\"value\":\"36864\"},{\"key\":\"redis_build_id\",\"value\":\"a4f7a6e86f2d60b3\"},{\"key\":\"connected_slaves\",\"value\":\"0\"},{\"description\":\"运行以来过期的key的数量\",\"key\":\"expired_keys\",\"value\":\"21\"},{\"description\":\"由 Redis 分配器分配的内存总量，以字节（byte）为单位\",\"key\":\"used_memory\",\"value\":\"735344\"},{\"descripti