文件，那么这个域记录的就是当前的创建操作已经耗费的秒数\",\"key\":\"rdb_current_bgsave_time_sec\",\"value\":\"-1\"},{\"description\":\"最近一次aof rewrite耗费的时长\",\"key\":\"aof_last_rewrite_time_sec\",\"value\":\"-1\"},{\"description\":\"配置文件目录\",\"key\":\"config_file\",\"value\":\"D:Redis\\redis.windows.conf\"},{\"description\":\"服务器是否正在载入持久化文件\",\"key\":\"loading\",\"value\":\"0\"},{\"key\":\"pubsub_channels\",\"value\":\"0\"},{\"key\":\"db0\",\"value\":\"keys=1,expires=1,avg_ttl=1798967\"},{\"key\":\"migrate_cached_sockets\",\"value\":\"0\"},{\"key\":\"redis_git_dirty\",\"value\":\"0\"},{\"description\":\"已连接客户端的数量（不包括通过从属服务器连接的客户端）\",\"key\":\"connected_clients\",\"value\":\"3\"},{\"description\":\" 以分钟为单位进行自增的时钟，用于 LRU 管理\",\"key\":\"lru_clock\",\"value\":\"5493557\"},{\"key\":\"pubsub_patterns\",\"value\":\"0\"},{\"key\":\"repl_backlog_first_byte_offset\",\"value\":\"0\"},{\"description\":\"redis网络出口流量字节数\",\"key\":\"total_net_output_bytes\",\"value\":\"5246261\"},{\"key\":\"client_biggest_input_buf\",\"value\":\"0\"},{\"description\":\"运行以来剔除(超过了maxmemory后)的key的数量\",\"key\":\"evicted_keys\",\"value\":\"0\"},{\"key\":\"total_connections_received\",\"value\":\"70\"},{\"description\":\"Redis 服务器版本\",\"key\":\"redis_version\",\"value\":\"3.0.504\"},{\"description\":\"redis网络入口流量字节数\",\"key\":\"total_net_input_bytes\",\"value\":\"176565\"},{\"key\":\"latest_fork_usec\",\"value\":\"37858\"},{\"description\":\" Redis 的内存消耗峰值(以字节为单位)\",\"key\":\"used_memory_peak\",\"value\":\"751752\"},{\"description\":\"命中次数\",\"key\":\"keyspace_hits\",\"value\":\"1195\"},{\"description\":\"自 Redis 服务器启动以来，经过的天数\",\"key\":\"uptime_in_days\",\"value\":\"1\"},{\"description\":\"redis网络入口kps\",\"key\":\"instantaneous_input_kbps\",\"value\":\"1.04\"},{\"key\":\"rdb_last_save_time\",\"value\":\"1582551222\"},{\"description\":\"redis当前的qps，redis内部较实时的每秒执行的命令数\",\"key\":\"instantaneous_ops_per_sec\",\"value\":\"4\"}]}', '0', null, '2020-02-24 21:44:22');
